function obstacle(){}obstacle.prototype=Object.create(item.prototype);obstacle.prototype.type="spiral";obstacle.prototype.fillColor="white";obstacle.prototype.init=function(){this.context=game.canvas.obstaclesContext;this.canvas=game.canvas.obstacles;this.spin=0;this.CartesianCoordinates=new Array();this.setDimension(game.cellWidth,game.cellHeight,true)};obstacle.prototype.animate=function(){var a=game.level.velocity;var b=(this.spin-(a/400));if(b<0){b=360}this.spin=b;this.draw();requestAnimFrame(function(){game.obstacle.animate()})};obstacle.prototype.are_we_doomed_yet=function(b,a){for(coordinate in this.CartesianCoordinates){if((b-1)==this.CartesianCoordinates[coordinate][0]&&(a-1)==this.CartesianCoordinates[coordinate][1]){game.player.type="skull";game.player.animable=false;game.showInformation("Doh!","The ship fall down in a swirl.","RETRY",function(){location.reload()});return true}}return false};obstacle.prototype.are_we_saved_yet=function(b,a){if((b)==game.island.col&&(a)==game.island.row){game.player.animable=false;game.showInformation("Hell Yeah!","The ship is in a safe place.","RETRY",function(){location.reload()});return true}return false};